Dread Uncut Edition (2009) 

Three college students set out to document what other people dread most. 

The runtime of this version is about 94 minutes and it's advertised as an uncut version. According to IMDB there's a 108 minute version too, the U.S. DVD is said to run 108 according to Amazon.com, but UK DVD is 90 minutes according to Amazon.co.uk (probably same cut as this with PAL-speedup making it a little shorter. 

